import classNames from 'classnames/bind';
import style from './Sidebar.module.scss';

const cx = classNames.bind(style);

function Sidebar() {
    return (
        <div className={cx('wrapper')}>
            <div></div>
            <span className={cx('library')}>Your Library</span>
        </div>
    );
}

export default Sidebar;
